                    <img src={thumbnail.thumbnail} alt="fuck" />
                  </div>
                  <h3>{thumbnail.titolo}</h3>
                  <p>
                    {thumbnail.autore} &#8226; {/*thumbnail.read_time*/}
                  </p>
                </div>
              </Border>
            </div>
          </>
        );
      })}
    </>
  );
};

export default SquareVisualizer;
